function aboutPage_js() {
    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'easterEggButton': 'aboutPage_easterEggButton',
        'aboutLabel1': 'aboutPage_aboutLabel1',
        'aboutLabel2': 'aboutPage_aboutLabel2',
        'dyjitLink': 'aboutPage_dyjitLink',
        'dyjitLogo': 'aboutPage_dyjitLogo',
        'spacer_3': 'aboutPage_spacer_3',
        'emailLabel': 'aboutPage_emailLabel',
        'emailLink': 'aboutPage_emailLink',
        'footerGrid': 'aboutPage_footerGrid',
        'registrationCell': 'aboutPage_registrationCell',
        'registrationLabel': 'aboutPage_registrationLabel',
        'linkCell': 'aboutPage_linkCell',
        'linkGrid': 'aboutPage_linkGrid',
        'touCell': 'aboutPage_touCell',
        'touLabel': 'aboutPage_touLabel',
        'privacyCell': 'aboutPage_privacyCell',
        'privacyPolicyLinkLabel': 'aboutPage_privacyPolicyLinkLabel',
        'versionCell': 'aboutPage_versionCell',
        'versionLabel': 'aboutPage_versionLabel'
    };
    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }
    /*
     * Nonvisual components
     */
    Apperyio.mappings = Apperyio.mappings || {};
    Apperyio.datasources = Apperyio.datasources || {};
    Apperyio.CurrentScreen = 'aboutPage';
    _.chain(Apperyio.mappings)
        .filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        })
        .each(Apperyio.UIHandler.hideTemplateComponents);
    /*
     * Events and handlers
     */
    // On Load
    var aboutPage_onLoad = function() {
        aboutPage_elementsExtraJS();
        aboutPage_deviceEvents();
        aboutPage_windowEvents();
        aboutPage_elementsEvents();
    };
    // screen window events
    function aboutPage_windowEvents() {
        $('#aboutPage').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });
        $('#aboutPage').on({
            pageshow: function(event) {
                if (window.cordova && window.cordova.getAppVersion) {
                    window.cordova.getAppVersion.getVersionNumber(function(version) {
                        Apperyio('versionLabel').text(version);
                    });
                };
            },
        });
    };
    // device events
    function aboutPage_deviceEvents() {
        document.addEventListener("deviceready", function() {
        });
    };
    // screen elements extra js
    function aboutPage_elementsExtraJS() {
        // screen (aboutPage) extra code
    };
    // screen elements handler
    function aboutPage_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });
        $(document).off("click", '#aboutPage_aboutHeader [name="easterEggButton"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('easterEggPage', {
                        transition: 'flip',
                        reverse: false
                    });
                }
            },
        }, '#aboutPage_aboutHeader [name="easterEggButton"]');
        $(document).off("click", '#aboutPage_aboutContainer [name="dyjitLogo"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    window.open('http://dyjet.com/', 'NewWindow', 'width=600,height=400,toolbar=yes,location=yes,directories=yes,status=yes,menubar=yes,scrollbars=yes,copyhistory=yes,resizable=yes');
                }
            },
        }, '#aboutPage_aboutContainer [name="dyjitLogo"]');
        $(document).off("click", '#aboutPage_aboutFooter [name="touLabel"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('touPage', {
                        transition: 'flip',
                        reverse: false
                    });
                }
            },
        }, '#aboutPage_aboutFooter [name="touLabel"]');
        $(document).off("click", '#aboutPage_aboutFooter [name="privacyPolicyLinkLabel"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    window.open('https://www.iubenda.com/privacy-policy/7831739', 'NewWindow', 'width=600,height=400,toolbar=yes,location=yes,directories=yes,status=yes,menubar=yes,scrollbars=yes,copyhistory=yes,resizable=yes');
                }
            },
        }, '#aboutPage_aboutFooter [name="privacyPolicyLinkLabel"]');
    };
    $(document).off("pagebeforeshow", "#aboutPage").on("pagebeforeshow", "#aboutPage", function(event, ui) {
        Apperyio.CurrentScreen = "aboutPage";
        _.chain(Apperyio.mappings)
            .filter(function(m) {
                return m.homeScreen === Apperyio.CurrentScreen;
            })
            .each(Apperyio.UIHandler.hideTemplateComponents);
    });
    aboutPage_onLoad();
};
$(document).off("pagecreate", "#aboutPage").on("pagecreate", "#aboutPage", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    aboutPage_js();
});